% Reglas con Listas de Argumentos 
% definicion de reglas
% Reglas para encontrar mexicanos de ciertas regiones o etnicidades

% ¬øCuantos mexicanos hay?
total_mexicanos(Total) :-
    write('Total de mexicanos: '),
    findall(Persona, nombre(Persona), ListaMexicanos),
    length(ListaMexicanos, Total).

% ¬øQue mexicanos hay en lista?

mexicanos_en_lista :-
    write('Mexicanos en la lista: '), nl,
    nombre(Persona),
    write(Persona), nl,
    fail.
mexicanos_en_lista.
% Regla para mostrar a todos los estados de mexico
estados_de_mexico :-
    write('Estados de Mexico: '), nl,
    estado(Estado),
    write(Estado), nl,
    fail.
estados_de_mexico.

% ¬øCuantos estados hay?
total_estados(Total) :-
    findall(Estado, estado(Estado), ListaEstados),
    sort(ListaEstados, ListaEstadosUnicos),  % Elimina duplicados
    length(ListaEstadosUnicos, Total),
    write('Total de estados de Mexico: '),
    writeln(Total).

% ¬øQue regiones existentes hay?
regiones_existentes :-
        setof(Region, region_geografica(Region), Regiones),
        write('Regiones existentes: '), nl,
        imprimir_lista(Regiones).
    imprimir_lista([]).
    imprimir_lista([Cabeza|Cola]) :-
        write(Cabeza), nl,
        imprimir_lista(Cola).



% Regla para verificar si una etapa es parte de las etapas de la vida
etapas_de_vida(Etapa) :-
    % Aqui se listan todas las etapas de vida disponibles
    member(Etapa, ['Infancia', 'Ninez', 'Adolescencia', 'Adultez', 'Adulto_mayor']).

% Reglas especificas para preguntas sobre las etapas de vida
es_etapa_de_vida(Etapa) :-
    etapas_de_vida(Etapa).

% Regla para verificar si un nivel educativo es valido
nivel_educativo(Nivel) :-
    % Aqui se listan todos los niveles educativos disponibles
    member(Nivel, [analfabetos, educacion_basica_incompleta, educacion_basica_completa, educacion_media_superior, educacion_superior, postgrado]).

% Reglas especificas para preguntas sobre los niveles educativos
es_nivel_educativo(Nivel) :-
    nivel_educativo(Nivel).

% Regla para verificar si una religion es valida
religion(Religion) :-
    % Aqui se listan todas las religiones disponibles
    member(Religion, [catolicos, protestantes_evangelicos, testigos_de_jehova, mormones, judios, musulmanes, budistas, hinduistas, sin_religion]).

% Reglas especificas para preguntas sobre las religiones
es_religion(Religion) :-
    religion(Religion).

% Regla para verificar si un estado es parte de Mexico
estado(Estado) :-
    % Aqui se listan todos los estados de Mexico
    member(Estado, ['Aguascalientes', 'Baja California', 'Baja California Sur', 'Campeche', 'Chiapas', 'Chihuahua', 'Ciudad de Mexico', 'Coahuila', 'Colima', 'Durango', 'Guanajuato', 'Guererro', 'Hidalgo', 'Jalisco', 'Estado de Mexico', 'Michoacan', 'Morelos', 'Nayarit', 'Nuevo Leon', 'Oaxaca', 'Puebla', 'Queretaro', 'Quintana Roo', 'San Luis Potosi', 'Sinaloa', 'Sonora', 'Tabasco', 'Tamaulipas', 'Tlaxcala', 'Veracruz', 'Yucatan', 'Zacatecas']).
% Reglas especificas para preguntas sobre los estados
es_estado(Estado) :-
    estado(Estado).

% Regla para determinar la region de una persona
mexicano_y_region(Persona, Region) :-
(   Region = 'Noroeste', pertenece_region(Persona, 'Noroeste')
;   Region = 'Noreste', pertenece_region(Persona, 'Noreste')
;   Region = 'Occidente', pertenece_region(Persona, 'Occidente')
;   Region = 'Centro-Norte', pertenece_region(Persona, 'Centro-Norte')
;   Region = 'Centro-Sur', pertenece_region(Persona, 'Centro-Sur')
;   Region = 'Este', pertenece_region(Persona, 'Este')
;   Region = 'Sureste', pertenece_region(Persona, 'Sureste')
;   Region = 'Suroeste', pertenece_region(Persona, 'Suroeste')
).

% Regla para determinar la etnicidad de una persona
mexicano_y_etnicidad(Persona, Etnicidad) :-
    ( Etnicidad = criollo, pertenece_etnicidad(Persona, criollo)
    ; Etnicidad = mestizo, pertenece_etnicidad(Persona, mestizo)
    ; Etnicidad = indigena, pertenece_etnicidad(Persona, indigena)
    ; Etnicidad = afrodescendiente, pertenece_etnicidad(Persona, afrodescendiente)
    ; Etnicidad = asiatico, pertenece_etnicidad(Persona, asiatico)
    ; Etnicidad = europeo, pertenece_etnicidad(Persona, europeo)
    ; Etnicidad = otro, pertenece_etnicidad(Persona, otro)
    ).

mexicano_y_religion(Persona, Religion) :-
    (
        Religion = catolico, pertenece_religion(Persona, catolico);
        Religion = protestantes_evangelicos, pertenece_religion(Persona, protestantes_evangelicos);
        Religion = testigos_de_jehova, pertenece_religion(Persona, testigos_de_jehova);
