% ¬øQue personas son suburbanos y no son activos politicamente?
suburbano_no_activo_politicamente(Persona) :-
    between(1, 395, N), 
    atom_concat('persona_residencia_posicion_politica', N, Predicado),
    MetaPredicado =.. [Predicado, Persona, suburbanos, PosicionesPoliticas],
    catch(call(MetaPredicado), _, fail),
    \+ member(activos_politicamente, PosicionesPoliticas),
    write('Persona que vive en areas suburbanas y no es activa politicamente: '), write(Persona), nl.

    
% ¬øQue personas tienen mas de una posicion politica?
mas_de_una_posicion_politica(Persona) :-
    between(1, 395, N), % Ajusta el rango seg√∫n la cantidad de hechos
    atom_concat('persona_residencia_posicion_politica', N, Predicado),
    MetaPredicado =.. [Predicado, Persona, _, PosicionesPoliticas],
    catch(call(MetaPredicado), _, fail),
    length(PosicionesPoliticas, NumeroPosiciones),
    NumeroPosiciones > 1,
    write('Persona con m√°s de una posici√≥n pol√≠tica: '), write(Persona), nl.

    
% ¬øQuienes son las personas sedentarias que son flexiterianas?   
sedentario_flexiteriano(Persona) :-
    between(1, 395, N), % Ajusta el rango seg√∫n la cantidad de hechos
    atom_concat('persona_salud_alimentacion', N, Predicado),
    MetaPredicado =.. [Predicado, Persona, _, sedentarios, Alimentacion],
    catch(call(MetaPredicado), _, fail),
    member(flexiterianos, Alimentacion),
    write('Persona sedentaria y flexitariana: '), write(Persona), nl.

    
% ¬øQue personas tienen una ocupacion artistica y viven en areas urbanas?  
artista_vive_en_urbano(Persona) :-
    between(1, 395, N), % Ajusta el rango seg√∫n la cantidad de hechos
    atom_concat('persona', N, Predicado),
    MetaPredicado =.. [Predicado, Persona, _, artista_artesano, _],
    catch(call(MetaPredicado), _, fail),
    persona_residencia_posicion_politica(Persona, urbanos, _),
    write('Persona artista que vive en √°rea urbana: '), write(Persona), nl.

    
